const Home = () => {
  const { data: shelters, loading, refresh } = useShelters({ cache: true });
  const [isModalOpen, setOpenModal] = useState<boolean>(false);
  const [, setSearchParams] = useSearchParams();
  const [filterData, setFilterData] = useState<IFilterFormProps>({
    ...initialFilterData,
    ...qs.parse(new URLSearchParams(window.location.search).toString()),
  });

  const [, setSearch] = useThrottle<string>(
    {
      throttle: 400,
      callback: () => {
        const params = new URLSearchParams(qs.stringify(filterData));

        setSearchParams(params);
        refresh({
          params: params,
        });
      },
    },
    []
  );

  const clearSearch = useCallback(() => {
    setSearch('');
    setFilterData(initialFilterData);
    setSearchParams('');
    refresh();
  }, [refresh, setSearch, setSearchParams]);

  const hasMore = useMemo(
    () => shelters.page * shelters.perPage < shelters.count,
    [shelters.page, shelters.perPage, shelters.count]
  );

  const onSubmitFilterForm = useCallback(
    (values: IFilterFormProps) => {
      setOpenModal(false);
      setFilterData(values);
      const searchQuery = qs.stringify(values, {
        skipNulls: true,
      });
      setSearchParams(searchQuery);
      refresh({
        params: {
          search: searchQuery,
        },
      });
    },
    [refresh, setSearchParams]
  );

  const handleFetchMore = useCallback(() => {
    const params = {
      ...shelters.filters,
      page: shelters.page + 1,
      perPage: shelters.perPage,
      search: qs.stringify(filterData),
    };

    refresh(
      {
        params: params,
      },
      true
    );
  }, [refresh, filterData, shelters.filters, shelters.page, shelters.perPage]);


  const searchAI = useCallback(async () => {

    try {
      const data = await ShelterServices.getAll();
      const test = "o que é inteligencia artificial?"
      const searchQuery = "Usando estes dados acima, quais são os três suprimentos mais importantes?";
      const dataToString = JSON.stringify(data);
      const dataToAi = `${dataToString} ${searchQuery}`;
      const result = await runChat(dataToAi);

      console.log(result);
      // setResults(data);
    } catch (e) {
      // setError(e.message);
    } finally {
      // setLoading(false);
    }
  }, []);

  return (
    <div className="flex flex-col h-screen items-center">
      {isModalOpen && (
        <Filter
          open={isModalOpen}
          data={filterData}
          onClose={() => setOpenModal(false)}
          onSubmit={onSubmitFilterForm}
        />
      )}
      <Header
        title="SOS Rio Grande do Sul"
        startAdornment={<BurgerMenu />}
        endAdornment={
          <div className="flex gap-2 items-center">
            <Button
              loading={loading}
              variant="ghost"
              size="sm"
              onClick={() => refresh()}
              className="disabled:bg-red-500 hover:bg-red-400"
            >
              <RotateCw size={20} className="stroke-white" />
            </Button>

            <Button
              loading={loading}
              variant="ghost"
              size="sm"
              onClick={() => searchAI()}
              className="disabled:bg-red-500 hover:bg-red-400"
            >
              <RotateCw size={20} className="stroke-white" />
            </Button>
          </div>
        }
      />
      <ShelterListView
        loading={loading}
        count={shelters.count}
        data={shelters.results}
        filterData={filterData}
        onFetchMoreData={handleFetchMore}
        searchValue={filterData.search}
        onSearchValueChange={(v) => {
          setFilterData((prev) => ({ ...prev, search: v }));
          setSearch(v);
        }}
        onCitiesChange={(v) => {
          setFilterData((prev) => ({ ...prev, cities: v }));
          const searchQuery = qs.stringify(
            { ...filterData, cities: v },
            {
              skipNulls: true,
            }
          );
          setSearchParams(searchQuery);
          refresh({
            params: {
              search: searchQuery,
            },
          });
        }}
        hasMoreItems={hasMore}
        onOpenModal={() => setOpenModal(true)}
        onClearSearch={clearSearch}
        className="flex-1 p-4 max-w-4xl"
      />
      <Footer />
    </div>
  );
};

export { Home };


